import React from 'react';
import { createRoot } from 'react-dom/client';
import App from './App';
import WaitlistContext from './context/Waitlist';
import './index.css';

const el = document.getElementById('root');
const root = createRoot(el);

root.render(
    <WaitlistContext.Provider>
        <App />
    </WaitlistContext.Provider>
);
